import React, { Component } from "react";
import Header from "../../components/header/Header";
import Footer from "../../components/footer/Footer";
import GithubRepoCard from "../../components/githubRepoCard/GithubRepoCard";
import Button from "../../components/button/Button";
import TopButton from "../../components/topButton/TopButton";
import { Fade } from "react-reveal";
import { projectsHeader } from "../../portfolio.js";
import ProjectsData from "../../shared/opensource/projects.json";
import "./Projects.css";
import ProjectsImg from "./ProjectsImg";

const ai_projects = [
  {
    "id": "MDEwOlJlcG9zaXRvcnkzMTUyOTkzNjg=",
    "name": "DSLR",
    "createdAt": "2020-11-23T11:52:33Z",
    "url": "https://github.com/XD-OB/DSLR",
    "description": "Harry Potter and a Data Scientist: Write a  multi-class classifier using gradient descent optimization algorithm to replace the bewitched Sorting Hat and save Hogwarts! üé©üßô‚Äç‚ôÇÔ∏è",
    "isFork": false,
    "languages": [
      {
        "name": "Python",
        "iconifyClass": "logos-python"
      },
    ]
  },
  {
    "id": "MDEwOlJlcG9zaXRvcnkzMTUCOTkzNjg=",
    "name": "ft_linear_regression",
    "createdAt": "2020-12-13T16:47:03Z",
    "url": "https://github.com/XD-OB/ft_linear_regression",
    "description": "Univariable Linear regression model ( Cars dataset Milage/Price ) üõ£Ô∏è üöó üí∞",
    "isFork": false,
    "languages": [
      {
        "name": "Python",
        "iconifyClass": "logos-python"
      },
    ]
  },
  {
    "id": "MDEwOlJlcG9zaXRvcnkyMzY4ODA2NjU=",
    "name": "lem_in",
    "createdAt": "2020-01-29T01:26:29Z",
    "url": "https://github.com/XD-OB/lem_in",
    "description": "gram an AI ant colony manager to help them cross a graph in as few strokes as possible, the result can be displayed with a visualizer üêúüêúüêú",
    "isFork": false,
    "languages": [
      {
        "name": "C",
        "iconifyClass": "logos-c"
      },
    ]
  }
];

class Projects extends Component {
  render() {
    const theme = this.props.theme;
    return (
      <div className="projects-main">
        <Header theme={theme} />
        <div className="basic-projects">
          <Fade bottom duration={2000} distance="40px">
            <div className="projects-heading-div">
              <div className="projects-heading-img-div">
                {/* <img
											src={require(`../../assests/images/${projectsHeader["avatar_image_path"]}`)}
											alt=""
										/> */}
                <ProjectsImg theme={theme} />
              </div>
              <div className="projects-heading-text-div">
                <h1
                  className="projects-heading-text"
                  style={{ color: theme.text }}
                >
                  {projectsHeader.title}
                </h1>
                <p
                  className="projects-header-detail-text subTitle"
                  style={{ color: theme.secondaryText }}
                >
                  {projectsHeader["description"]}
                </p>
              </div>
            </div>
          </Fade>
        </div>

        <br/>
        <br/>
        <h1>Algorithm & AI projects</h1>
        <div className="repo-cards-div-main">
          {ai_projects.map((repo) => {
            console.log(repo);
            return <GithubRepoCard repo={repo} theme={theme} />;
          })}
        </div>

        <h1>Algorithm projects</h1>
        <h1>Mobile</h1>

        <div className="repo-cards-div-main">
          {ProjectsData.data.map((repo) => {
            console.log(repo);
            return <GithubRepoCard repo={repo} theme={theme} />;
          })}
        </div>

        <Button
          text={"More Projects"}
          className="project-button"
          href="https://github.com/XD-OB/"
          newTab={true}
          theme={theme}
        />
        <Footer theme={this.props.theme} onToggle={this.props.onToggle} />
        <TopButton theme={this.props.theme} />
      </div>
    );
  }
}

export default Projects;
